import React from "react";
import ReactDOM from "react-dom";

const inputClick = () => console.log("Clicked");

const textH = {
  name: "Damir",
  age: 18
};

const elements=(
  <div>
    <h1>Hello, {textH.name}</h1>
    <h1></h1>
    <p>
      <input placeholder="999" onClick={console.log(inputClick)}></input>
    </p>
    <p>
      {textH.age===18 ? "YES" : "NO"}
    </p>
  </div>
)


ReactDOM.render(elements, document.getElementById("root"));
